import React from 'react';
const Site = () => {
    return (


        <footer>
            <div className="area1">
                Area 1 Content
            </div>
            <div className="area2">
                Area 2 Content
            </div>
            <div className="area3">
                Area 3 Content
            </div>
            <div className="area4">
                Area 4 Content
            </div>
        </footer>

    );
}

export default Site;
